$shadow-dark: 0px 1px 3px 0px #1B1B1B !default



//== Animations
//
//## Define speed for animations

//** Default Animation speed
$animate-speed: 0.4s !default

//** Fast Animation speed
$animate-speed-fast: 0.1s !default

